<script>
    var n =0  ;
    $(document).ready(function(){
        
        $("button").click(function(){
            if(n == 34) {
           
           window.location.reload();
         
          } else {
            $(this).hide();
           document.getElementById('vbanim'+n).beginElement();
           
        
           
         if(n == 33) {
            
           document.getElementById('myButton1').innerHTML ="GO AGAIN !!!";
           document.getElementById('myButton1').style.color ="#ffdead";
           document.getElementById('myButton1').style.backgroundColor  ="#ff0000";
           
           }
           n =n+1;
        } 
           
           
        });	
        
    });
    
        function enableButton() {
        $("button").show();
        }
    </script>
